import React, { useEffect } from "react";

const Post = (post) => {
  useEffect(() => {
    console.log(post.singer1);
  }, []);

  return (
    <div>
      <h3>Leader: {post.leader}</h3>
      <div>singer1: {post.singer1}</div>
    </div>
  );
};

export default Post;
